import styles from "./ProjectSection.module.scss";
import GoogleBooksProj from "../../styles/GoogleBooksProj.png";
import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';

export const ProjectSection = () => {
  return (
    <div className={styles.projects}>
      <h2 className={styles.projects__title}>Thing's I've built and worked on </h2>
      <div className={styles.projects__list}>
        <img
          src={GoogleBooksProj}
          height="400"
          className={styles.projects__list_img}
        ></img>
        <div className={styles.projects__list_desc}>
          <h6>Featured Project</h6>
          <h3>Google Books Project</h3>
          <p>My version of book search engine that uses the Google Books API</p>
          <p>Created using HTML SASS CSS</p>
        </div>
      </div>
    </div>
  );
};
